		// >> City Ledger
		private MySqlCommand insertCommand;
		private void btnCityLedger_Click(System.Object sender, System.EventArgs e)
		{
			try
			{
				int i;
				for (i = 100; i <= 999; i++)
				{
					insertCommand = new MySqlCommand("insert into `cityledger` values(\'" + "G-0000000" + i + "\',\'" + string.Format("{0:yyyy-MM-dd}",DateTime.Now.Date.AddDays(1)) + "\',\'FILLER\',1000.00,0.00,\'" + "F-0000000" + i + "\',\'B\',1,\'2005-01-02 11:12:12\',\'ADMIN\',\'2005-01-02 11:12:12\',\'ADMIN\',\'0\');", localCon);
					insertCommand.ExecuteNonQuery();
				}
				
				MessageBox.Show("yahoo");
			}
			catch (Exception ex)
			{
				
				MessageBox.Show(ex.Message);
			}
		}
		
		
		
		// >> Cash Ledger [csledger sa DATABASE]
		private void btnCsLedger_Click(System.Object sender, System.EventArgs e)
		{
			
			try
			{
				int i;
				for (i = 100; i <= 999; i++)
				{
                    insertCommand = new MySqlCommand("insert into `csledger` values (\'" + "I-0000000" + i + "\',\'" + string.Format("{0:yyyy-MM-dd}", DateTime.Now.Date.AddDays(1)) + "\',\'FILLER\',\'1500.00\',\'0.00\',\'0.00\',\'0.00\',\'1500.00\',\'" + "F-0000000" + i + "\',\'A\',1,\'2005-01-02 11:12:12\',\'ADMIN\',\'2005-01-02 11:12:12\',\'ADMIN\',\'0\');", localCon);
					insertCommand.ExecuteNonQuery();
				}
				
				MessageBox.Show("yahoo");
			}
			catch (Exception ex)
			{
				
				MessageBox.Show(ex.Message);
			}
			
		}
		
