		private void btnRoomEve_Click(System.Object sender, System.EventArgs e)
		{
			try
			{
				long c;
				string[] folio = new string[99];
				long start = long.Parse(this.txtFolioId.Text);
				
				DateTime folioDate = this.dtpDateFrom.Value;
				while (folioDate < this.dtpDateTo.Value)
				{
					DateTime dateFrom = folioDate;
                    DateTime dateTo = folioDate.AddDays(2);
					
					folioDate = dateTo;
					
					for (c = 0; c <= 97; c++)
					{
						folio[c] = "F-" + string.Format("{0:D10}",start + c);
					}
					
					start = long.Parse(folio[97].Substring(2)) + 1;
					
					
					int i;
					
					string str;
					for (i = 0; i <= DateTimeClass.DateDiff(DateTimeClass.DateInterval.Day, dateFrom, dateTo); i++)
					{
						
